package main

import "fmt"

func main() {
	width, height := len(input[0]), len(input)
	at := func(p position) int {
		return input[p.y][p.x]
	}

	shortestPathSteps := func(startX, startY int) (int, bool) {
		start := pos(startX, startY)
		end := pos(endX, endY)

		steps := map[position]int{
			start: 0,
		}
		wasAt := func(p position) bool {
			_, ok := steps[p]
			return ok
		}

		queue := []position{start}
		for len(queue) > 0 {
			p := queue[0]
			queue = queue[1:]

			left := pos(p.x-1, p.y)
			right := pos(p.x+1, p.y)
			up := pos(p.x, p.y-1)
			down := pos(p.x, p.y+1)

			check := func(next position) {
				if next.x >= 0 && next.x < width &&
					next.y >= 0 && next.y < height &&
					at(next) <= at(p)+1 &&
					(!wasAt(next) || steps[p]+1 < steps[next]) {
					steps[next] = steps[p] + 1
					queue = append(queue, next)
				}
			}

			check(left)
			check(right)
			check(up)
			check(down)
		}

		n, ok := steps[end]
		return n, ok
	}

	startToEnd, _ := shortestPathSteps(startX, startY)
	fmt.Println("part 1)", startToEnd)

	min := 999999999
	for y := 0; y < height; y++ {
		for x := 0; x < width; x++ {
			if at(pos(x, y)) == 0 {
				steps, reached := shortestPathSteps(x, y)
				if reached && steps < min {
					min = steps
				}
			}
		}
	}
	fmt.Println("part 2)", min)
}

func pos(x, y int) position {
	return position{x: x, y: y}
}

type position struct {
	x, y int
}

